import React from "react";
import "./ResultsList.css";

export const ResultsList = ({ results }) => {
  return (
    <ul>
      {results.map((album) => (
        <li key={album.id}>
        {`${album.title}`} <strong>by {album.artist}</strong> ({album.firstReleaseDate}, id: {album.id})
      </li>      
      ))}
    </ul>
  );
};
